// function which starts the game
function playGame() {
    turns = 0
    guessedPlayers = []
    // Hides the play and exit buttons
    document.getElementById("PlayButton").style.display="none";
    document.getElementById("ExitButton").style.display="none";
    document.getElementById("Text2").style.display="none";
    document.getElementById("lineText1").style.display="none";
    document.getElementById("Text3").style.display="none";
    tds = document.getElementsByTagName('td');

    for (i = 0; i < tds.length; i++) {
        tds[i].innerHTML = "";
        tds[i].className = "black";
    }

    // Updates text 
    document.getElementById("Text1").innerHTML = "Enter names in the fields, then click submit:";

    // Shows the text boxes and submit button
    document.getElementById("fullName").style.display="inline-block";
    document.getElementById("submitName").style.display="inline-block";

    // Chooses a random player
    var randomPlayer = chooseRandomPlayer()

    // if enter is pressed the submit button is pressed
    document.body.onkeyup = function(e){
        if(e.key == 'Enter'){
            submitPlayer()
        }
    }

}

// Function which links text boxes to a player in the list, and checks for black, yellow or green info
function submitPlayer() {

    // stores the values of the text within the text boxes
    var fname = document.getElementById("fullName").value;
    var fullName = fname.split(" ");
    var fname = fullName[0]
    var lname = fullName[1]

    // Capitalises the first letter in the word
    fname = fname[0].toUpperCase() + fname.substring(1);
    lname = lname[0].toUpperCase() + lname.substring(1);


    // Erases the value inside the text boxes
    document.getElementById('fullName').value = ""

    var chosenPlayer = ""
    // Finds the player that matches the name, sets the player as chosenPlayer and changes text to show the selected player
    for (let i = 0; i < players.length; i++) {
        if (fname == players[i][1] && lname == players[i][2]){
            chosenPlayer = players[i]
            document.getElementById("Text1").innerHTML = ("You selected: " + players[i][1] + " " + players[i][2] + " from " + players[i][3]); 
            document.getElementById("lineText1").innerHTML = ("-------------------------------");
            }
        }
        if (chosenPlayer == "") {
            document.getElementById("Text1").innerHTML = "Player not found. Enter names in the fields, then click submit:"; 
            document.getElementById('fullName').value = ""
            return
        }
        else if (guessedPlayers.includes(chosenPlayer[1] + " " + chosenPlayer[2])){
            document.getElementById("Text1").innerHTML = "Player already guessed. Enter names in the fields, then click submit:"; 
            document.getElementById('fullName').value = ""
            return
        }

    turns += 1  // Adds 1 to turn to represent each turn

    // Sets the variables for chosenPlayer for readability
    firstName = chosenPlayer[1]
    lastName = chosenPlayer[2]
    fullName = firstName + " " + lastName
    team = chosenPlayer[3]
    guernsey = chosenPlayer[5]
    birthDate = chosenPlayer[6]
    height = chosenPlayer[7]
    state = chosenPlayer[9]
    games = chosenPlayer[11]

    // Adds guessed player to list of guessed players
    guessedPlayers.push(fullName)

    // If chosen player is not random player, display the colours associated with all the info and adds the colours to a string to present to the user
    checkFirstName(firstName)
    checkLastName(lastName)
    checkTeam(team)
    checkGuernsey(guernsey)
    checkBirthDate(birthDate)
    checkHeight(height)
    checkState(state)
    console.log()

    // If chosen player matches the random player, show everything as green and remove the text boxes and submit
    if (fname == randomPlayer[1] && lname == randomPlayer[2]) {
        document.getElementById("Text2").style.display="block";
        document.getElementById("Text1").innerHTML = ("You got it, it was " + " " + randomPlayer[1] + " " + randomPlayer[2] + "! Congratulations!");
        document.getElementById("Text2").innerHTML = ("Do you wish to play again?")
        document.getElementById("PlayButton").style.display="inline-block";
        document.getElementById("ExitButton").style.display="inline-block";
        document.getElementById("fullName").style.display="none";
        document.getElementById("submitName").style.display="none";
        return
    } 

    // If the user has exhausted their amount of turns and the chosen player is not the random player, remove the text boxes and submit, and show game over
    if (turns == 6 && chosenPlayer != randomPlayer) {
        document.getElementById("fullName").style.display="none";
        document.getElementById("submitName").style.display="none";
        document.getElementById("Text1").innerHTML = ("Sorry, you ran out of tries. The player was " + randomPlayer[1] + " " + randomPlayer[2] + " from " + randomPlayer[3]); 
        document.getElementById("Text2").innerHTML = ("Do you wish to play again?")
        document.getElementById("PlayButton").style.display="inline-block";
        document.getElementById("ExitButton").style.display="inline-block";
        return
    }
}

